function fillFormDispatchReport(){let a=$("#createDispatchReportModal");$.ajax({type:"GET",url:"/report/dailyDispatchReport",data:{name:$("params.name").val(),date:$("params.date").val(),hours:$("params.hours").val(),active_loads:$("params.active_loads").val(),active_drivers:$("params.active_drivers").val(),inactive_drivers:$("params.inactive_drivers").val(),loads_finalized:$("params.loads_finalized").val(),worked_time:$("params.worked_time").val(),dispatch_score:$("params.dispatch_score").val(),score_app_usage:$("params.score_app_usage").val()},success:s=>{const i=a.find("#definidor");i.empty(),i.append(`<div class="form-group"><div class="row"><div class="col-md-3">Dispatch Name:</div> <div class="col-md-3">${s.name}</div><div class="col-md-3">Date:</div><div class="col-md-3">${s.date}</div></div><br><div class="row"><div class="col-md-3">Hours:</div><div class="col-md-3">${s.hours}</div><div class="col-md-3">In Transit:</div><div class="col-md-3">${s.active_loads}</div></div><br><div class="row"><div class="col-md-3">Active Trucks:</div><div class="col-md-3">${s.active_drivers}</div><div class="col-md-3">Inactive Trucks:</div><div class="col-md-3">${s.inactive_drivers}</div></div><br><div class="row"><div class="col-md-3">Time in Dispatch:</div><div class="col-md-3">${msToTime(1e3*s.worked_time*60,!1)}</div><div class="col-md-3">Loads Dispatch:</div><div class="col-md-3">${s.loads_finalized}</div></div><br><div class="row"><div class="col-md-3">App Usage Score</div><div class="col-md-3">${s.score_app_usage}</div><div class="col-md-3">Dispatch Score</div><div class="col-md-3">${s.dispatch_score}</div></div><br><div for="situationDescription">Situation Description: </div><textarea id="situationDescription" name="situationDescription" rows="4" placeholder="Was there an event?" style="width:100%"></textarea><br><br><div for="situationDescription">Well Status: </div><textarea id="wellStatus" name="wellStatus" rows="4" style="width:100%" placeholder="Describe Well Status:"></textarea></div>`)},error:()=>{throwErrorMsg()}}),$("#createDispatchReportModal").modal("show")}$("#submitDispatchReport").submit((function(a){a.preventDefault();let s=$("#createDispatchReportModal"),i=s.find("textarea").serialize();$.ajax({type:"POST",url:"/report/storeDispatchReport",data:i,success:a=>{throwErrorMsg("Report Generated correctly",{title:"Success!",type:"success"}),$("#createDispatchReportModal").modal("hide"),$.each(s.find("textarea"),(function(a,s){s.value=""}))},error:()=>{throwErrorMsg()}})}));
